import { Avatar, Box, Card, CardHeader, Grid } from "@material-ui/core";
import {red} from "@material-ui/core/colors"

const projectList = [1];

function Projects() {
    return (
        <Box overflow='auto' p={3}>
            <Grid container>
                {projectList.map(item =>
                    <Grid item>
                        <Card>
                            <CardHeader
                                avatar={<Avatar sx={{bgcolor:red[500]}}>API</Avatar>}
                                title='API Weather APP' subtitle=''>

                            </CardHeader>
                        </Card>
                    </Grid>
                    )}
            </Grid>
        </Box>
    )
};

export default Projects;
